import ReactDOM from 'react-dom/client';
import './css/index.css';
import App from './App';

const a = true;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {a ? <App /> : <h1></h1>}
    <App />
  </React.StrictMode>
);
